import React from 'react'

function PostedComments(props) {
    console.log(props)
    return (
        <div>
            <p>{props.mainVideo.comments[0].name}</p>
            <p>{props.mainVideo.comments[0].timestamp}</p>
            <p>{props.mainVideo.comments[0].comment}</p>
        </div>
    )
}

export default PostedComments
